settings.cardCss:
.navbar {
    list-style-type: none;
    height: 100%;
    background-color: white;
}

.navbar a {
    height: 100%;
    float: left;
    padding: 0 15px 0 15px;
    margin: 0 5px 0 5px;
    color: black;
    text-decoration: none;
    text-align: center;
    text-transform: uppercase;
    display: flex;
    justify-content: center;
    align-items: center;
    position: relative;
}

.navbar a:hover {
    color: black;
    background-color: #a8d5ba; /* Light green */
    border-radius: 5px;
    border: 0 solid #e0e0e0;
}

.active {
    color: black !important;
    background-color: #8bc34a !important; /* Light green */
    border-radius: 5px;
}

.material-icons {
    font-size: 20px;
    padding-right: 5px;
    color: black;
}

[data-md-tooltip] {
    position: relative;
}

@media screen and (max-width: 960px) {
    .menutext {
        display: none;
    }

    .navbar a::before {
        content: attr(data-md-tooltip);
        position: absolute;
        bottom: -35px;
        left: 50%;
        padding: 8px;
        transform: translateX(-50%) scale(0);
        transition: transform 0.3s ease-in-out;
        transform-origin: top;
        background: #616161e6;
        color: white;
        border-radius: 2px;
        font-size: 12px;
        white-space: nowrap;
        z-index: 1;
    }

    .navbar a:hover::before {
        transform: translateX(-50%) scale(1);
    }

    .material-icons {
        font-size: 28px;
        color: black;
    }
}

